import React from 'react';
import '../App.css';
import profile from '../img/profile.png';

function User(){
    return (

        <div className="App">
        <nav class="navbar  navbar-dark bg-dark">
            <div class="navbar-brand ">IRUN - Basic C++</div>
            <img src = {profile} className="img-pro"></img>
        
</nav>
<header className="App-header">

<div class="card shadow p-3 mb-5 bg-white rounded" className="App-card-Topic">
  <div class="card-body">
      <div class="row">
          <div class="col-md-4 shadow-lg bg-white rounded">
          <img src = {profile} className="img-topi"></img>

          </div>
      </div>
    
  </div>
</div>
</header>
</div>

    );

}

export default User;
